import React, { useEffect, useRef, useState } from 'react';
import { Modal, Button, Space, message, Alert, Typography } from 'antd';
import { CameraOutlined, CloseOutlined, ReloadOutlined } from '@ant-design/icons';
import { Html5QrcodeScanner, Html5Qrcode } from 'html5-qrcode';

const { Text } = Typography;

const QRScanner = ({ 
  visible, 
  onClose, 
  onScan, 
  title = "Qu√©t Serial Number",
  placeholder = "ƒê∆∞a camera v√†o m√£ QR ho·∫∑c Barcode" 
}) => {
  const scannerRef = useRef(null);
  const [isScanning, setIsScanning] = useState(false);
  const [error, setError] = useState(null);
  const [scannerInstance, setScannerInstance] = useState(null);

  useEffect(() => {
    if (visible) {
      startScanner();
    } else {
      stopScanner();
    }

    return () => {
      stopScanner();
    };
  }, [visible]);

  const startScanner = async () => {
    try {
      setError(null);
      setIsScanning(true);

      // Clear any existing scanner
      if (scannerInstance) {
        await scannerInstance.stop();
      }

      // Create scanner configuration optimized for mobile
      const config = {
        fps: 10,
        qrbox: { width: 300, height: 200 },
        aspectRatio: 1.0,
        disableFlip: false,
        // Support both QR codes and barcodes
        formatsToSupport: [
          Html5QrcodeScanner.SUPPORTED_FORMATS.QR_CODE,
          Html5QrcodeScanner.SUPPORTED_FORMATS.CODE_128,
          Html5QrcodeScanner.SUPPORTED_FORMATS.CODE_39,
          Html5QrcodeScanner.SUPPORTED_FORMATS.CODE_93,
          Html5QrcodeScanner.SUPPORTED_FORMATS.EAN_13,
          Html5QrcodeScanner.SUPPORTED_FORMATS.EAN_8,
          Html5QrcodeScanner.SUPPORTED_FORMATS.UPC_A,
          Html5QrcodeScanner.SUPPORTED_FORMATS.UPC_E
        ]
      };

      const scanner = new Html5QrcodeScanner(
        "qr-reader",
        config,
        false // verbose logging
      );

      scanner.render(
        (decodedText, decodedResult) => {
          // Success callback
          message.success(`üì± ƒê√£ qu√©t th√†nh c√¥ng: ${decodedText}`);
          onScan(decodedText);
          stopScanner();
          onClose();
        },
        (error) => {
          // Error callback - don't show errors for scanning attempts
          // console.warn(`QR scan error: ${error}`);
        }
      );

      setScannerInstance(scanner);
      setIsScanning(true);

    } catch (err) {
      console.error('Scanner initialization error:', err);
      setError('Kh√¥ng th·ªÉ kh·ªüi t·∫°o camera. Vui l√≤ng ki·ªÉm tra quy·ªÅn truy c·∫≠p camera.');
      setIsScanning(false);
    }
  };

  const stopScanner = async () => {
    try {
      if (scannerInstance) {
        await scannerInstance.clear();
        setScannerInstance(null);
      }
      setIsScanning(false);
    } catch (err) {
      console.error('Error stopping scanner:', err);
    }
  };

  const handleClose = () => {
    stopScanner();
    onClose();
  };

  const handleRestart = () => {
    stopScanner();
    setTimeout(() => {
      startScanner();
    }, 500);
  };

  return (
    <Modal
      title={
        <div style={{ display: 'flex', alignItems: 'center', gap: '8px' }}>
          <CameraOutlined style={{ color: '#1890ff' }} />
          <span>{title}</span>
        </div>
      }
      open={visible}
      onCancel={handleClose}
      width={600}
      footer={
        <Space>
          <Button onClick={handleRestart} icon={<ReloadOutlined />}>
            Qu√©t l·∫°i
          </Button>
          <Button onClick={handleClose} icon={<CloseOutlined />}>
            ƒê√≥ng
          </Button>
        </Space>
      }
      destroyOnClose={true}
      centered
    >
      <div style={{ textAlign: 'center', padding: '20px 0' }}>
        {error ? (
          <Alert
            message="L·ªói Camera"
            description={error}
            type="error"
            showIcon
            style={{ marginBottom: 16 }}
            action={
              <Button size="small" onClick={handleRestart}>
                Th·ª≠ l·∫°i
              </Button>
            }
          />
        ) : (
          <Alert
            message="H∆∞·ªõng d·∫´n qu√©t"
            description={placeholder}
            type="info"
            showIcon
            style={{ marginBottom: 16 }}
          />
        )}

        {/* Scanner container */}
        <div 
          id="qr-reader" 
          style={{ 
            width: '100%',
            maxWidth: '500px',
            margin: '0 auto',
            border: '2px dashed #d9d9d9',
            borderRadius: '8px',
            minHeight: '300px',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center'
          }}
        >
          {!isScanning && !error && (
            <div style={{ textAlign: 'center', color: '#999' }}>
              <CameraOutlined style={{ fontSize: '48px', marginBottom: '16px' }} />
              <div>ƒêang kh·ªüi t·∫°o camera...</div>
            </div>
          )}
        </div>

        <div style={{ marginTop: 16, fontSize: '12px', color: '#666' }}>
          <Text type="secondary">
            üí° H·ªó tr·ª£ qu√©t: QR Code, Code 128, Code 39, EAN-13, UPC-A v√† nhi·ªÅu ƒë·ªãnh d·∫°ng kh√°c
          </Text>
        </div>
      </div>
    </Modal>
  );
};

export default QRScanner;
